import React, {useState}from 'react'

export default function State() {
    
    const [value,setValue]=useState(valueId)
    const [valueId,setValueId]=useState(1)
    fetch("https://jsonplaceholder.typicode.com/posts")
    .then((res)=>res.json())
    .then((data)=>setValue(data))
    function update(){
      //setValue('salma')
      setValue(prev=>prev+1)
   }
   function updateDown(){
      //setValue('salma')
      setValueId(prev=>prev-1)
   }
  return (
    <div>
        <button onClick={update}>+</button>
        <button onClick={updateDown}>-</button>
     {value.map((pst)=>(
      
        {value:valueId?<h1>{pst.titre}</h1>:<h1>{pst.id}</h1> 
        
       
        }

     ))}
     
<h1>{value}</h1>
  </div>
  )
}













